import React, { Component } from 'react';


export class SortTwoArray extends Component {
    constructor(props) {
        super(props)

        this.state = {
            actions: [],
            step: 0
        }
        this.firstArray = [7, 5, 16, 4]
        this.secondArray = [6, 7, 2, 9]

        getSteps()
    }

    render() {
        return(
            <div>This is sort 1</div>
        )
    }
}
